import { Component } from 'react';

//클래스 방식
class TOC extends Component {
  render() {
    //반복문
    let list;
    for(let i=0; i<this.props.contents.lenght; i++) {
      list += <li>
                <a href={ this.props.contents[i].id + '.html'}
                  onClick={(e) => {
                    this.props.onChangePage('html');
                    e.preventDefault(); 
                  }}>
                  {this.props.contents[0].title}   
                </a>
              </li>;
    }

    return (
      <nav>
        <ul> {list} </ul>
      </nav>
    );
  }
}

export {TOC};
